import { gql } from "@apollo/client";

export const CREATE_QUESTION = gql`
  mutation CreateQuestion($inputQuestion: CreateQuestion) {
    createQuestion(inputQuestion: $inputQuestion) {
      ... on QuestionSuccess {
        message
        question {
          userId {
            name
            avatarImage
            question {
              title
              tags {
                TagName
              }
            }
          }
          chatGptAnswer
          answers {
            _id
          }
          tags {
            _id
          }
        }
      }
      ... on QuestionFailure {
        message
        args
      }
    }
  }
`;
